import React from "react";
import styled from "styled-components";

const NinthPage = () => {
  return (
    <Container>
      <img src="/images/model-s/big-blue.jpg" alt="" />
      <Wrap1>
        <h1>405mi</h1>
        <p>Go anywhere with up to 405 miles of</p>
        <p>estimated range on a single charge</p>
      </Wrap1>
      <Wrap2>
        <h1>200mi</h1>
        <p>Supercharge up to 200 miles in</p>
        <p>15 minutes</p>
      </Wrap2>
      <Wrap3>
        <h1>25,000+</h1>
        <p>Superchargers placed along popular</p>
        <p>routes</p>
      </Wrap3>
    </Container>
  );
};

const Container = styled.div`
  height: 100vh;
  img {
    height: 100%;
    width: 70%;
  }
`;
const Wrap1 = styled.div`
  h1 {
    color: rgb(249, 249, 249);
    transform: translate(130px, -140px);
    font-family: "Open Sans", sans-serif;
    font-weight:500;
  }
  }
  p {
    color: rgb(249, 249, 249);
    transform: translate(100px, -130px);
    font-size:15px;
    
  }
`;

const Wrap2 = styled.div`
h1 {
    color: rgb(249, 249, 249);
    transform: translate(450px, -215px);
    font-family: "Open Sans", sans-serif;
    font-weight:500;
  }
  }
  p {
    color: rgb(249, 249, 249);
    transform: translate(420px, -205px);
    
  }`;
const Wrap3 = styled.div`
  h1 {
    color: rgb(249, 249, 249);
    transform: translate(700px, -290px);
    font-family: "Open Sans", sans-serif;
    font-weight: 500;
  }
  p {
    color: rgb(249, 249, 249);
    transform: translate(700px, -280px);
  }
`;
export default NinthPage;
